	('ARIA_PAGECACHE_AGE_THRESHOLD', NULL, '300', 'COMPILE-TIME', '300', 'GLOBAL', 'BIGINT UNSIGNED', 'This characterizes the number of hits a hot block has to be untouched until it is considered aged enough to be downgraded to a warm block. This specifies the percentage ratio of that number of hits to the total number of blocks in the page cache.', '100', '18446744073709551615', '100', NULL, 'NO', 'REQUIRED'),
	('PERFORMANCE_SCHEMA', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enable the performance schema.', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL'),
	('SQL_MODE', '', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', 'COMPILE-TIME', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', 'SESSION', 'SET', 'Sets the sql mode', NULL, NULL, NULL, 'REAL_AS_FLOAT,PIPES_AS_CONCAT,ANSI_QUOTES,IGNORE_SPACE,IGNORE_BAD_TABLE_OPTIONS,ONLY_FULL_GROUP_BY,NO_UNSIGNED_SUBTRACTION,NO_DIR_IN_CREATE,POSTGRESQL,ORACLE,MSSQL,DB2,MAXDB,NO_KEY_OPTIONS,NO_TABLE_OPTIONS,NO_FIELD_OPTIONS,MYSQL323,MYSQL40,ANSI,NO_AUTO_VALUE_ON_ZERO,NO_BACKSLASH_ESCAPES,STRICT_TRANS_TABLES,STRICT_ALL_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ALLOW_INVALID_DATES,ERROR_FOR_DIVISION_BY_ZERO,TRADITIONAL,NO_AUTO_CREATE_USER,HIGH_NOT_PRECEDENCE,NO_ENGINE_SUBSTITUTION,PAD_CHAR_TO_FULL_LENGTH,EMPTY_STRING_IS_NULL,SIMULTANEOUS_ASSIGNMENT', 'NO', 'REQUIRED'),
	('PERFORMANCE_SCHEMA_EVENTS_WAITS_HISTORY_LONG_SIZE', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Number of rows in EVENTS_WAITS_HISTORY_LONG. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED'),
	('PERFORMANCE_SCHEMA_MAX_TABLE_INSTANCES', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Maximum number of instrumented tables. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED'),
	('PERFORMANCE_SCHEMA_MAX_COND_CLASSES', NULL, '80', 'COMPILE-TIME', '80', 'GLOBAL', 'BIGINT UNSIGNED', 'Maximum number of condition instruments.', '0', '256', '1', NULL, 'YES', 'REQUIRED'),
	('PERFORMANCE_SCHEMA_EVENTS_STAGES_HISTORY_LONG_SIZE', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Number of rows in EVENTS_STAGES_HISTORY_LONG. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED'),
