	('INNODB_DEFRAGMENT', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enable/disable InnoDB defragmentation (default FALSE). When set to FALSE, all existing defragmentation will be paused. And new defragmentation command will fail.Paused defragmentation commands will resume when this variable is set to true again.', NULL, NULL, NULL, 'OFF,ON', 'NO', 'REQUIRED'),
	('PERFORMANCE_SCHEMA_MAX_RWLOCK_INSTANCES', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Maximum number of instrumented RWLOCK objects. Use 0 to disable, -1 for automated sizing.', '-1', '104857600', '1', NULL, 'YES', 'REQUIRED'),
	('FT_MIN_WORD_LEN', NULL, '4', 'COMPILE-TIME', '4', 'GLOBAL', 'BIGINT UNSIGNED', 'The minimum length of the word to be included in a FULLTEXT index. Note: FULLTEXT indexes must be rebuilt after changing this variable', '1', '84', '1', NULL, 'YES', 'REQUIRED'),
