	('INNODB_STATS_TRANSIENT_SAMPLE_PAGES', NULL, '8', 'COMPILE-TIME', '8', 'GLOBAL', 'BIGINT UNSIGNED', 'The number of leaf index pages to sample when calculating transient statistics (if persistent statistics are not used, default 8)', '1', '18446744073709551615', '0', NULL, 'NO', 'REQUIRED'),
	('PERFORMANCE_SCHEMA_EVENTS_STATEMENTS_HISTORY_SIZE', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Number of rows per thread in EVENTS_STATEMENTS_HISTORY. Use 0 to disable, -1 for automated sizing.', '-1', '1024', '1', NULL, 'YES', 'REQUIRED'),
	('SLOW_LAUNCH_TIME', NULL, '2', 'COMPILE-TIME', '2', 'GLOBAL', 'BIGINT UNSIGNED', 'If creating the thread takes longer than this value (in seconds), the Slow_launch_threads counter will be incremented', '0', '31536000', '1', NULL, 'NO', 'REQUIRED'),
	('PERFORMANCE_SCHEMA_ACCOUNTS_SIZE', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Maximum number of instrumented user@host accounts. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED'),
