	('MAX_STATEMENT_TIME', '0.000000', '0.000000', 'COMPILE-TIME', '0.000000', 'SESSION', 'DOUBLE', 'A query that has taken more than max_statement_time seconds will be aborted. The argument will be treated as a decimal value with microsecond precision. A value of 0 (default) means no timeout', '0', '31536000', NULL, NULL, 'NO', 'REQUIRED'),
