	('VERSION', NULL, '10.3.38-MariaDB-1:10.3.38+maria~ubu1804', 'COMPILE-TIME', NULL, 'GLOBAL', 'VARCHAR', 'Server version number. It may also include a suffix with configuration or build information. -debug indicates debugging support was enabled on the server, and -log indicates at least one of the binary log, general log or slow query log are enabled, for example 10.1.1-MariaDB-mariadb1precise-log.', NULL, NULL, NULL, NULL, 'YES', NULL),
